import React from "react";
import "./Contact.css";
const Contact =() => {
  return(
    <div className="contact-form">
      <div className="w-left">
        <div className="awesome">
          <span>Contact Me</span>
          <span>Get IN Touch</span>
          <div
          className="blur s-blur" style={{background:"#ABF1"}}>

          </div>
        </div>
      </div>
    </div>
  )
}
